import React from "react";
import { Link, useParams } from "react-router-dom";

const Nav = ()=> {
    const {name} = useParams();
    return (
        <nav className="NavBar">
            <Link to="/dogs">
                Dog List
            </Link>
            <Link to="/dogs/:name">
                {name.toUpperCase()}
            </Link>
        </nav>
    )
};

export default Nav;
